import React from 'react';



export default function Contact() {
  return (

    <div id='contact' className="container-fluid pt-5 text-center">
      <br></br><br></br><br></br><br></br><br></br>
      <p>If you would like to know more about me or on how to contact me then all the links are below</p><br></br>
      <a href="mailto: christianle21@yahoo.com" target="_blank" rel="noopener noreferrer"><i aria-hidden="true" style={{ width: '2em', fontSize: '1.5em' }}></i></a>
      <a href="https://github.com/christianle21/" target="_blank" rel="noopener noreferrer"><i aria-hidden="true" style={{ width: '2em', fontSize: '1.8em' }}></i></a>
      <a href="https://www.linkedin.com/in/thechristianle/" target="_blank" rel="noopener noreferrer"><i aria-hidden="true" style={{ width: '2em', fontSize: '1.8em' }}></i></a>
      <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>

    </div>
  );
}
